import * as React from 'react';

import { View, Text, Image, Button } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { Home } from '../sacreen/Home';
import { About } from '../sacreen/About';

import { Contect } from '../sacreen/contant';

function Navigatuon() {
    const Stack = createNativeStackNavigator();
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen
                    name='Home'
                    component={Home}
                    options={{
                        title: 'My Home',
                        headerRight: () => (
                            <Button
                                onPress={() => alert('This is a button!')}
                                title='Info'
                                color='red'
                            />
                        ),
                        headerTitle: (props) => (
                            <Image
                                source={{
                                    uri: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQFwDpwH9iUblEH7e6bKJK_Z8neX-M_q8WR4A&usqp=CAU',
                                }}
                                style={{
                                    height: 100,
                                    width: 100,
                                    // borderRadius: 50,
                                    resizeMode: 'contain',
                                }}
                            />
                        ),
                        headerStyle: {
                            // backgroundColor: '#f4511e',
                        },
                        headerTintColor: '#fff',
                        headerTitleStyle: {
                            fontWeight: 'bold',
                        },
                    }}
                />
                <Stack.Screen name='About' component={About} />

                <Stack.Screen name='Contect' component={Contect} />
            </Stack.Navigator>
        </NavigationContainer>
    );
}

export { Navigatuon };
